nbsp; you build your own portfolio process and you can edit the structure as you want.&lt;br&gt;&lt;br&gt;&lt;br&gt;</text><lastmodified>2016-02-22 18:14:15</lastmodified>',1,1,'2016-05-02 18:34:18'),(0xEFAE747728D64FE390E7918BA3AB9BDB,'nodeRes','<code/><label lang=\"fr\">Ce portfolio</label><label lang=\"en\">KARUTA Project</label>',1,1,'2016-05-02 18:34:18'),(0x78B1E140CFE240CEB349F92E2536BB86,'nodeRes','<code/><label lang=\"fr\"/><label lang=\"en\"/>',1,1,'2016-05-02 18:34:18'),(0x9CB373BF942045459703DC2371E3232B,'context','<text lang=\"fr\"/><text lang=\"en\"/>',1,1,'2016-05-02 18:34:18'),(0xD8E22183575B4674947B1EF61ADA0BAA,'Image','<filename lang=\"fr\">line.gif</filename><size lang=\"fr\">1103</size><type lang=\"fr\">image/gif</type><fileid lang=\"fr\">012bd083-999e-4c11-b57a-c1b5a88c7b21</fileid><filename lang=\"en\">line.gif</filename><size lang=\"en\">1103</size><type lang=\"en\">image/gif</type><fileid lang=\"en\">483b5d3e-71c4-4394-91a1-04a64efc6887</fileid>',1,1,'2016-05-02 18:34:18'),(0x406F512605944058B3908CE3680D8976,'nodeRes','<code/><label lang=\"fr\">Présentation</label><label lang=\"en\">Introducing Karuta</label>',1,1,'2016-05-02 18:34:17'),(0x73673B4741FB4D3D8E03885F991F4786,'context','<text lang=\"fr\"/><text lang=\"en\"/>',1,1,'2016-05-02 18:34:17'),(0x4B7076F1980546D7951754E16D8DBFD1,'context','<text lang=\"fr\"/><text lang=\"en\"/>',1,1,'2016-05-02 18:34:17'),(0x9A58973A0B7A4434A6E2AA2B0174089E,'TextField','<text lang=\"fr\">Un exemple de ePortfolio Karuta à personnaliser&lt;br&gt;</text><text lang=\"en\">A portfolio sample&lt;br&gt;</text>',1,1,'2016-05-02 18:34:17'),(0xD899F4D7958B41AE8560C2E98B54FAC0,'nodeRes','<code/><label lang=\"fr\">Titre de la page d\'accueil</label><label lang=\"en\">Welcom title</label>',1,1,'2016-05-02 18:34:17'),(0xF136B815E51E404A9E2529236E47ABB2,'context','<text lang=\"fr\"/><text lang=\"en\"/>',1,1,'2016-05-02 18:34:17'),(0x4B4E8EBB55214D3EBB92AD8B41426016,'Field','<text lang=\"fr\">Bienvenue dans KARUTA Portf