02 18:34:16'),(0x8636036C4E4B43D0900105148AE4AF0F,'nodeRes','<code/><label lang=\"fr\">KARUTA</label><label lang=\"en\">This Portfolio</label><value/>',1,1,'2016-05-02 18:34:16'),(0xC2DEA3362CE744569DE862CEB89EDAE0,'context','<text lang=\"fr\"/><text lang=\"en\"/>',1,1,'2016-05-02 18:34:16'),(0xB26DD3F301104E2091499117F425D2C2,'nodeRes','<code/><label lang=\"fr\"/><label lang=\"en\"/>',1,1,'2016-05-02 18:34:16'),(0xC2F29AD772C644699A6A7AC6125F007B,'context','<text lang=\"fr\"/><text lang=\"en\"/>',1,1,'2016-05-02 18:34:16'),(0x2E65A83797D04AD29E0B22017D4DAAC5,'TextField','<text lang=\"fr\">Karuta est un logiciel Open Source qui permet de créer des ePortfolios. Vous bâtissez votre propre modèle de portfolio.&lt;br&gt;&lt;br&gt;</text><text lang=\"en\">This portfolio has been built to give you an idea of the software\'s possibilities.&lt;br&gt;&lt;br&gt;The content of this page, the menu, the fonts, and the background colors can be edited.&lt;br&gt;&lt;br&gt;Just do it!&lt;br&gt;</text><lastmodified>28/4/2016 12:16:53</lastmodified>',1,1,'2016-05-02 18:34:16'),(0x62D6B88416844DC0A82CA76C7CC10041,'nodeRes','<code/><label lang=\"fr\">Utile!</label><label lang=\"en\">Tips!</label>',1,1,'2016-05-02 18:34:16'),(0x539CEF37727C46008EAA371562DB8CD4,'context','<text lang=\"fr\"/><text lang=\"en\"/>',1,1,'2016-05-02 18:34:16'),(0xAB059C1509114FD39B0FE7A7D339F2CE,'nodeRes','<code/><label lang=\"fr\"/><label lang=\"en\"/>',1,1,'2016-05-02 18:34:16'),(0xEDB80D3CB25A439DBBD10D39742DB1AE,'context','<text lang=\"fr\"/><text lang=\"en\"/>',1,1,'2016-05-02 18:34:15'),(0x2A0A3C2DAFF4435BAB0019DAD8AF4380,'nodeRes','<code/><label lang=\"fr\">Portfolio - Barre de navigation</label><label lang=\"en\">Portfolio Navigation Bar</label>',1,1,'2016-05-02 18:34:15'),(0x389E37640629467CABBDFBA53449572B,'nodeRes','<code>karuta.model</code><label lang=\"en\">KARUTA - Portfolio Model</label><label lang=\"fr\">KARUTA - Portfolio - Modèle</label>',1,1,'2016-05-02 18:34:15'),(0x7B8F964F5F6C4252B3A20A69D